import Vue from 'vue'
import VueRouter from 'vue-router'
import FormInscription from '../components/FormInscription.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/inscription',
    name: 'Home',
    component: FormInscription
  }

]

const router = new VueRouter({
  routes
})

export default router
